import React from "react";
import {Link} from "react-router-dom";
import "./styles/Footer.css";
import "./styles/Navigationbar.css";

const footer = props => (
  <div className="footer toolbarNavigationItems">
    <ul className="footer-ul">
      <li>
        <button className="button1">Impressum</button>
      </li>
      <li>|</li>
      <li>
        <button className="button1">Kontakt</button>
      </li>
    </ul>
  </div>
);

export default footer;
